function goToWallet(c){try{if(localStorage){var a=localStorage.getItem("guid");if(a!=null){if(c==null){window.location="https://blockchain.info/wallet/"+a}else{window.location="https://blockchain.info/wallet/"+a+"#newaddr|"+c}return}}}catch(b){console.log(b)}if(c==null){window.location="https://blockchain.info/wallet"}else{window.location="https://blockchain.info/wallet/new#newaddr|"+c}}$(document).ready(function(){$("#add-to-wallet").click(function(){goToWallet(address)});$("#deposit").click(function(){loadScript(resource+"wallet/frame-modal.js",function(){showFrameModal({title:"Deposit Using Cash",description:"Deposit into address <b>"+address+"</b>",top_right:'Have Questions? Read <a href="https://www.bitinstant.com/howitworks/cash" target="new">How It Works</a>',src:root+"deposit?address="+address+"&ptype=bitinstant"})})});$("#payment-request").click(function(){loadScript(resource+"wallet/frame-modal.js",function(){showFrameModal({title:"Create Payment Request",description:"Request Payment into address <b>"+address+"</b>",src:root+"payment_request?address="+address})})});$("#create-donation-button").click(function(){loadScript(resource+"wallet/frame-modal.js",function(){showFrameModal({title:"Create Donation Button",description:"Create Donation Button To Address <b>"+address+"</b>",src:root+"create_donation_button?address="+address,height:"600px"})})});$("#filter").change(function(){console.log("Change");$(this).parent().submit()});try{var a=new WebSocket(getWebSocketURL());a.onmessage=function(k){var j=$.parseJSON(k.data);if(j.op=="status"){$("#status").html(j.msg)}else{if(j.op=="utx"){op=j.x;try{playSound("beep")}catch(k){console.log(k)}var d=TransactionFromJSON(op);d.setConfirmations(0);var c=0;for(var h=0;h<d.inputs.length;h++){var g=d.inputs[h];console.log(g.prev_out.addr);if(g.prev_out.addr==address){c-=parseInt(g.prev_out.value)}}console.log("result "+c);var l=0;for(var h=0;h<d.out.length;h++){var f=d.out[h];if(f.addr==address){l+=parseInt(f.value)}}$("#total_received span").attr("data-c",parseInt($("#total_received span").attr("data-c"))+l);c+=l;$("#final_balance span").attr("data-c",parseInt($("#final_balance span").attr("data-c"))+c);flashTitle("New Transaction");d.result=c;$("#no_tx").hide();$("#tx_container").prepend(d.getHTML());$("#tx-"+op.txIndex).fadeIn("slow").slideDown("slow");console.log($("#n_transactions").val());$("#n_transactions").text(parseInt($("#n_transactions").text())+1);calcMoney()}}};a.onopen=function(){$("#status").html("Connected. ");a.send('{"op":"addr_sub", "addr":"'+address+'"}')};a.onclose=function(){$("#status").html("Disconnected")}}catch(b){console.log(b)}});